let rec clone x n = 
  if (n > 0) then x::(clone x (n-1))
  else
    []



let _ = clone 3 5;;
let _ = clone "foo" 2;; 
let _ = clone clone (-3);;


let padZero l1 l2 = 
  let x = List.length l1 in 
  let y = List.length l2 in
    if( x = y) then (l1,l2)
    else
    if( x < y) then ((clone 0 (y-x))@l1,l2)
    else (l1,(clone 0 (x-y))@l2)


let _ = padZero [9;9] [1;0;0;2]
let _ = padZero [1;0;0;2] [9;9] 


let rec removeZero l = match l with
  | [] -> []
  | h::t -> if(h = 0) then removeZero t
      else l



let _ = removeZero [0;0;0;1;0;0;2]
let _ = removeZero [9;9]
let _ = removeZero [0;0;0;0]



let bigAdd l1 l2 = 
  let add (l1, l2) = 
    let f a x = let (l1x,l2x) = x in let (a1,a2) = a in
      let test = match a1 with 
        | [] -> 0
        | h::t -> h in
      let sum = l1x+l2x+test in 
        if(List.length a2 = ((List.length l1)-1)) then ((sum/10)::a1,(sum/10)::(sum mod 10)::a2) 
        else ((sum/10)::a1,(sum mod 10)::a2) 
    in
    let base = ([],[])  in
    let args = List.rev (List.combine l1 l2) in
    let (_, res) = List.fold_left f base args in res
  in 
    removeZero (add (padZero l1 l2))



let _ = bigAdd [9;9] [1;0;0;2];;
let _ = bigAdd [9;9;9;9] [9;9;9];; 



let rec mulByDigit i l = 
  if(i < 1) then []
  else 
    bigAdd l (mulByDigit (i-1) l)



let _ = mulByDigit 9 [9;9;9;9]



let bigMul l1 l2 = 
  let f a x =  let (a1,a2) = a in
    let test = match a1 with
      | [] -> 1
      | h::t -> 10*h in
    let multi = mulByDigit (test*x) l1 in
      (test::a1,bigAdd multi a2) in
  let base = ([],[]) in
  let args = List.rev l2 in
  let (_, res) = List.fold_left f base args in
    res


let _ = bigMul [9;9;9;9] [9;9;9;9]
let _ = bigMul [9;9;9;9;9] [9;9;9;9] 








